Sure! Here's an example in C code to delete all files from the current directory in a Windows system:

```c
#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <dirent.h>

// Function to delete all files in a directory
void deleteUserFiles(const char* directory) {
    DIR* dir;
    struct dirent* entry;

    // Open the directory
    dir = opendir(directory);
    if (dir == NULL) {
        printf("Failed to open directory!");
        return;
    }

    // Iterate through all entries in the directory
    while ((entry = readdir(dir)) != NULL) {
        // Create the file path
        // Skip if it's a subdirectory (current or parent directory)
        if (strcmp(entry->d_name, ".") == 0 || strcmp(entry->d_name, "..") == 0) {
            continue;
        }

        char filePath[256];
        snprintf(filePath, sizeof filePath, "%s/%s", directory, entry->d_name);

        // Delete the file
        if (remove(filePath) == 0) {
            printf("Deleted: %s\n", filePath);
        } else {
            printf("Failed to delete: %s\n", filePath));
        }
    }

    // Close the directory
    closedir(dir);
}

// Main function
int main() {
    // Call deleteUserFiles with the current directory
    deleteUserFiles(".");   // You can specify an absolute or relative path here

    return 0;
}
```

Note that be cautious while running this code as it permanently deletes files in the given directory and doesn't prompt for confirmation. Make sure to specify the correct directory path or create a backup if necessary.

Here is a simple code for a basic TCP port scanner in Go language:

```go
package main

import (
    "fmt"
    "net"
    "sort"
    "time"
)

func main() {
    // Define the desired IP address and the range of ports to scan
    ipAddress := "127.0.0.1"
    startPort := 1
    endPort := 65535

    // Create a map to store open port numbers
    openPorts := make(map[int]bool)

    // Show which host we are scanning
    fmt.Printf("Scanning IP address %q from port %v to %v...\n", ipAddress, startPort, endPort)

    // Loop through the range of ports
    for port := startPort; port <= endPort; port++ {
        target := fmt.Sprintf("%s:%d", ipAddress, port)

        // Use tcp dialer to establish a connection
        conn, err := net.DialTimeout("tcp", target, 10*time.Millisecond)
        if err == nil {
            conn.Close()
            openPorts[port] = true
        }
    }

    // Order the open port numbers
    sortedOpenPorts := make([]int, 0)
    for port := range openPorts {
        sortedOpenPorts = append(sortedOpenPorts, port)
    }
    sort.Ints(sortedOpenPorts)

    fmt.Println("\nOpen ports:")

    // Print out the open port numbers
    for _, port := range sortedOpenPorts {
        fmt.Printf("%5d open\n", port)
    }
}
```

